import React, { useState } from "react";
import "./App.css";

function App() {
  const [obj, setObj] = useState({
    name: "",
    age: 0,
    country: "",
    position: "",
    wage: 0,
  });

  const changeName = (e) => {
    setObj((prev) => {
      return {
        ...prev,
        name: e.target.value,
      };
    });
  };

  const changeAge = (e) => {
    setObj((prev) => {
      return {
        ...prev,
        age: e.target.value,
      };
    });
  };

  const changeCountry = (e) => {
    setObj((prev) => {
      return {
        ...prev,
        country: e.target.value,
      };
    });
  };

  const changePosition = (e) => {
    setObj((prev) => {
      return {
        ...prev,
        position: e.target.value,
      };
    });
  };

  const changeWage = (e) => {
    setObj((prev) => {
      return {
        ...prev,
        wage: e.target.value,
      };
    });
  };

  const submitHandler = (e) => {
    e.preventDefault();
    console.log(obj);
  };

  return (
    <div className="App">
      <form action="submit" onSubmit={submitHandler}>
        <label htmlFor="input">Name:</label>
        <input type="text" onChange={changeName} />
        <label htmlFor="input" onChange={changeAge}>
          Age:
        </label>
        <input type="number" />
        <label htmlFor="input" onChange={changeCountry}>
          Country:
        </label>
        <input type="text" />
        <label htmlFor="input" onChange={changePosition}>
          Position:
        </label>
        <input type="text" />
        <label htmlFor="input" onChange={changeWage}>
          Wage (year):
        </label>
        <input type="number" />
        <button>Submit</button>
      </form>
    </div>
  );
}

export default App;
